import React from 'react';
import './App.css';

function App() {
  const [images, setImages] = React.useState([]);

  const [data, setData] = React.useState('')
  React.useEffect(() => {
    setImages(['2', '10', '20', '25'])
    callBackEnd().then(data => setData(data))
  }, [])



  return (
    <div className='container'>
      <div className='row justify-content-center mt-2'>Images</div>
      <div className='row mt-5'>{images.map(image => <div className='col-2'>{image}</div>)}</div>
      <div>{data}</div>
    </div>
  );
}

export default App;

async function callBackEnd() {
  const response = await fetch('/backend');
  const body = await response.json();

  if (response.status !== 200) {
    throw Error(body.message)
  }
  return body;
}
